YUI.add('srpl-business-templates', function(Y){
// DO NOT EDIT THIS FILE
// this should be automatically generated by using the .*.html files in templates
Y.namespace('srpl.Business');
Y.srpl.Business.templates = {
    base:Y.template('<div class="srpl-header">\n    <div class="srpl-hero-container f-left column1">\n        <%= Y.srpl.Business.templates.hero_container({b:b}) %>\n    </div>\n    <div class="srpl-map f-right column2"></div>\n</div>\n<div class="srpl-body">\n    <div class="f-left column1">\n        <%= Y.srpl.Business.templates.description({b:b}) %>\n        <%= Y.srpl.Business.templates.gallery({b:b}) %>\n        <%= Y.srpl.Business.templates.reviews({b:b}) %>\n    </div>\n    <div class="f-right column2">\n    	<%= Y.srpl.Business.templates.details({b:b}) %>\n    </div>\n</div>'),
		description:Y.template('<% if (b.get(\'slogan\')) { %>\n<div class="srpl-container">\n    <h6><%= b.get(\'slogan\') %></h6>\n</div>\n<% }%>'),
		details:Y.template('<div class="srpl-container">\n    <h3>Book for tonight on OpenTable</h3>\n</div>'),
		gallery:Y.template('<% if (b.get(\'thumbnail_photos\') && b.get(\'thumbnail_photos\').count) { %>\n    <div class="srpl-container">\n        <ul class="srpl-gallery">\n        <%\n        var photos = b.get(\'thumbnail_photos\').photo.slice(0,Y.srpl.config(\'business.galleryCount\'));\n        Y.each(photos, function(p,i){ %>\n            <li>\n                <img src="<%= p.thumb.url %>" alt="<%= b.displayValue() %>"/>\n            </li>\n        <%}); %>\n        </ul>\n    </div>\n<% }%>'),
		hero_actions:Y.template('<ul class="actions clearfix">\n    <li class="first-child">\n        <button title="Send to phone" type="button" class="send-phone transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Send to phone</div>\n       </button>\n    </li>\n    <li>\n        <button title="Directions" type="button" class="directions transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Directions</div>\n       </button>\n    </li>\n    <li>\n        <button title="Share" type="button" class="share transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Share</div>\n       </button>\n    </li>\n    <li class="last-child">\n        <button title="Menu" type="button" class="menu transparent">\n            <i class="icon"></i>\n            <div class="text f-right">Menu</div>\n       </button>\n    </li>\n</ul>'),
		hero_container:Y.template('<div class="srcpl-hero-container">\n    <img class="hero" src="<%= b.get(\'herophoto\') %>" alt="<%= b.displayValue() %>"/>\n    <div class="srcpl-hero-content-container">\n        <h1><%= b.displayValue() %></h1>\n        <h2><%= b.get(\'ycatsprimary\').data[0].name %></h2>\n        <% if (b.get(\'rating\') && !isNaN(b.get(\'rating\'))) { %>\n        <p class="rating-review">\n            <a target="_blank" href="<%= b.get(\'readreviewsurl\') %>">\n                <span class="rating-static f-left rating-<%= (b.get(\'rating\')*10) %>">\n                    <%= b.get(\'rating\') %> out of 5 stars\n                </span>\n                <% if (b.get(\'nreview\')) {%>\n                (<span class="review">based on </span><%= b.get(\'nreview\') %> reviews)\n                <% } %>\n            </a>\n        </p>\n        <% } if (b.address()) {%>\n        <p class="adr"><%= b.address() %></p>\n        <% } if (b.get(\'phone\')) {%>\n        <p class="tel"><%= b.get(\'phone\') %></p>\n        <% } if (b.get(\'website\') && b.get(\'website\')[\'$\']) {%>\n        <p class="web">\n            <a href="<%= b.get(\'website\')[\'$\'] %>" target="_blank" class="url" title="<%= b.get(\'websitelabel\') || b.get(\'website\')[\'@label\'] %>">\n                <%= b.get(\'webLabel\') %>\n            </a>\n        </p>\n        <% } %>\n        <%= Y.srpl.Business.templates.hero_actions() %>\n    </div>\n</div>'),
		reviews:Y.template('<% if (b.get(\'latestreview\')) { %>\n<div class="srpl-container">\n    <h3>What people say</h3>\n    <p><%= b.get(\'latestreview\') %></p>\n</div>\n<% }%>')
};
}, '@VERSION@',{
    // [bug 5892107] no need to require assets     
    requires:['srpl-template']
});